import './Result.css';

import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/effect-cards";

// import required modules
import { EffectCards } from "swiper";

const ResultDetail = ({title}) => {
    return (
        <div class = "resultDetail">
            <div class = "image">
                image
            </div>
            <div class = "text_r">
                <div> {title} </div>
                <div> text </div>
            </div>
        </div>
    );
}



const Result = () => {
    return (
        <div class = "Result">
            <div class = "Rtop">
                Result
            </div>
            <div class = "Rbottom">
                <Swiper
                    effect={"cards"}
                    grabCursor={true}
                    modules={[EffectCards]}
                    className="mySwiper"
                >
                    <SwiperSlide><ResultDetail title = "돌아가고 싶다" /></SwiperSlide>
                    <SwiperSlide>Slide 2</SwiperSlide>
                    <SwiperSlide>Slide 3</SwiperSlide>
                    <SwiperSlide>Slide 4</SwiperSlide>
                </Swiper>
            </div>
        </div>
    );
}

export default Result;
